    const btnType = ['positive','negative'].includes(type) ? type : 'default';

    return (
        <button className={["MyButton",`MyButton_${type}`].join(" ")} onClick={onClick}>
            {text}
        </button>
    )
}

MyButton.defaultProps = {
    type: "default"
};

